#include <stdio.h>
#include <stdlib.h>
#define n 16

void quicksort(int a[], int low, int high);
int main(void) {
  int a[n];
  for (int i = 0; i < n; i++)
    scanf("%d", &a[i]);
  quicksort(a, 0, n - 1);
  for (int i = 0; i < n; i++)
    printf("%d ", a[i]);
  return 0;
}

void quicksort(int a[], int low, int high)
{
	if(low>=high)
		return ;
	int left=low, right=high, pivot=a[low];
	while(left!=right)
	{
		while(a[right]>pivot && left < right)   //找比pivot小的 
			right-=1;
		while(a[left]<=pivot && left < right)   //找比pivot大的 
			left+=1;
		if(left < right)  //兩者找到之後就交換 
		{
			int temp=a[left];
			a[left]=a[right];
			a[right]=temp;
		}
	}
	a[low]=a[left];
	a[left]=pivot;
	quicksort(a, left+1, high);   //處理比pivot大的 
	quicksort(a, low, right-1);   //處理比pivot小的 
}


